//@param object is an array of already simulated features of currentTrack
function calcLiveAverage(object){
	var sumSpeed = 0;
	var avgSpeed;
	var sumCons = 0;
	var avgCons;
	var sumCo2 = 0;
	var avgCo2;
	for(var i in object){
		sumSpeed += object[i].properties.phenomenons.Speed.value;
		sumCons += object[i].properties.phenomenons.Consumption.value;
		sumCo2 += object[i].properties.phenomenons.CO2.value;
	}
	avgSpeed = sumSpeed / object.length;
	avgCons = sumCons / object.length;
	avgCo2 = sumCo2 / object.length;
	return {
		avgSpeed: avgSpeed,
		avgConsumption: avgCons,
		avgCo2: avgCo2
	};
}